import "./App.css";
import { Routes, Route, useNavigate, Link, Outlet } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route
          path="/"
          element={
            <>
              <section className="section first">
                <h1>첫번째 섹션</h1>
              </section>
            </>
          }
        />
      </Routes>
    </div>
  );
}

function Header() {
  return (
    <header className="navbar_container">
      <div className="navbar_box">
        <div className="navbar_logo_container">
          <span className="navbar_logo_title">LUMINA </span>
          <span className="navbar_logo_subtext">Design Lab</span>
        </div>
        <ul className="navbar_items">
          <li className="navbar_item">Home</li>
          <li className="navbar_item">About</li>
          <li className="navbar_item">Contact</li>
        </ul>
        <div className="red_bubble">
          <span>상담혜택</span>
        </div>
      </div>
    </header>
  );
}

export default App;
